import {NavLink} from 'react-router-dom';
import styles from './Header.module.css';
const Header = () => {
    return <header className={styles["main-header"]}>
                <h1 className={styles.h1}>CRM</h1>
                    <nav>
                        <ul>
                            <li>
                                <NavLink></NavLink>
                            </li>
                        </ul>
                    </nav>
            </header>
}

export default Header;
